const zigbeeHerdsmanConverters = require('zigbee-herdsman-converters');
const zigbeeHerdsmanUtils = require('zigbee-herdsman-converters/lib/utils');


const exposes = zigbeeHerdsmanConverters['exposes'] || require("zigbee-herdsman-converters/lib/exposes");
const ea = exposes.access;
const e = exposes.presets;
const fz = zigbeeHerdsmanConverters.fromZigbeeConverters || zigbeeHerdsmanConverters.fromZigbee;
const tz = zigbeeHerdsmanConverters.toZigbeeConverters || zigbeeHerdsmanConverters.toZigbee;

const ptvo_switch = (zigbeeHerdsmanConverters.findByModel)?zigbeeHerdsmanConverters.findByModel('ptvo.switch'):zigbeeHerdsmanConverters.findByDevice({modelID: 'ptvo.switch'});
fz.legacy = ptvo_switch.meta.tuyaThermostatPreset;
fz.ptvo_on_off = {
  cluster: 'genOnOff',
  type: ['attributeReport', 'readResponse'],
  convert: (model, msg, publish, options, meta) => {
      if (msg.data.hasOwnProperty('onOff')) {
          const channel = msg.endpoint.ID;
          const endpointName = `l${channel}`;
          const binaryEndpoint = model.meta && model.meta.binaryEndpoints && model.meta.binaryEndpoints[endpointName];
          const prefix = (binaryEndpoint) ? model.meta.binaryEndpoints[endpointName] : 'state';
          const property = `${prefix}_${endpointName}`;
	  if (binaryEndpoint) {
            return {[property]: msg.data['onOff'] === 1};
          }
          return {[property]: msg.data['onOff'] === 1 ? 'ON' : 'OFF'};
      }
  },
};


const switchTypesList = {
    'switch': 0x00,
    'single click': 0x01,
    'multi-click': 0x02,
    'reset to defaults': 0xff,
};

const switchActionsList = {
    on: 0x00,
    off: 0x01,
    toggle: 0x02,
};

const inputLinkList = {
    no: 0x00,
    yes: 0x01,
};

const bindCommandList = {
    'on/off': 0x00,
    'toggle': 0x01,
    'change level up': 0x02,
    'change level down': 0x03,
    'change level up with off': 0x04,
    'change level down with off': 0x05,
    'recall scene 0': 0x06,
    'recall scene 1': 0x07,
    'recall scene 2': 0x08,
    'recall scene 3': 0x09,
    'recall scene 4': 0x0A,
    'recall scene 5': 0x0B,
};

function getSortedList(source) {
    const keysSorted = [];
    for (const key in source) {
        keysSorted.push([key, source[key]]);
    }

    keysSorted.sort(function(a, b) {
        return a[1] - b[1];
    });

    const result = [];
    keysSorted.forEach((item) => {
        result.push(item[0]);
    });
    return result;
}

function getListValueByKey(source, value) {
    const intVal = parseInt(value, 10);
    return source.hasOwnProperty(value) ? source[value] : intVal;
}

const getKey = (object, value) => {
    for (const key in object) {
        if (object[key] == value) return key;
    }
};

tz.ptvo_on_off_config = {
    key: ['switch_type', 'switch_actions', 'link_to_output', 'bind_command'],
    convertGet: async (entity, key, meta) => {
        await entity.read('genOnOffSwitchCfg', ['switchType', 'switchActions', 0x4001, 0x4002]);
    },
    convertSet: async (entity, key, value, meta) => {
        let payload;
        let data;
        switch (key) {
        case 'switch_type':
            data = getListValueByKey(switchTypesList, value);
            payload = {switchType: data};
            break;
        case 'switch_actions':
            data = getListValueByKey(switchActionsList, value);
            payload = {switchActions: data};
            break;
        case 'link_to_output':
            data = getListValueByKey(inputLinkList, value);
            payload = {0x4001: {value: data, type: 32 /* uint8 */}};
            break;
        case 'bind_command':
            data = getListValueByKey(bindCommandList, value);
            payload = {0x4002: {value: data, type: 32 /* uint8 */}};
            break;
        }
        await entity.write('genOnOffSwitchCfg', payload);
    },
};

fz.ptvo_on_off_config = {
    cluster: 'genOnOffSwitchCfg',
    type: ['readResponse', 'attributeReport'],
    convert: (model, msg, publish, options, meta) => {
        const channel = getKey(model.endpoint(msg.device), msg.endpoint.ID);
        const {switchActions, switchType} = msg.data;
        const inputLink = msg.data[0x4001];
        const bindCommand = msg.data[0x4002];
        return {
            [`switch_type_${channel}`]: getKey(switchTypesList, switchType),
            [`switch_actions_${channel}`]: getKey(switchActionsList, switchActions),
            [`link_to_output_${channel}`]: getKey(inputLinkList, inputLink),
            [`bind_command_${channel}`]: getKey(bindCommandList, bindCommand),
        };
    },
};

fz.ptvo_switch_analog_input = {
    cluster: 'genAnalogInput',
    type: ['attributeReport', 'readResponse'],
    convert: (model, msg, publish, options, meta) => {
        const payload = {};
        const channel = msg.endpoint.ID;
        const name = `l${channel}`;
        const endpoint = msg.endpoint;
        payload[name] = precisionRound(msg.data['presentValue'], 3);
        const cluster = 'genLevelCtrl';
        if (endpoint && (endpoint.supportsInputCluster(cluster) || endpoint.supportsOutputCluster(cluster))) {
            payload['brightness_' + name] = msg.data['presentValue'];
        } else if (channel === 5) {
            payload['uptime' + '_' + name] = precisionRound(msg.data['presentValue'], 3);
        } else if (msg.data.hasOwnProperty('description')) {
            const data1 = msg.data['description'];
            if (data1) {
                const data2 = data1.split(',');
                const devid = data2[1];
                const unit = data2[0];
                if (devid) {
                    payload['device_' + name] = devid;
                }

                const valRaw = msg.data['presentValue'];
                if (unit) {
                    let val = precisionRound(valRaw, 1);

                    const nameLookup = {
                        'C': 'temperature',
                        'V': 'voltage',
                        'A': 'current',
                        'W': 'power',
                    };

                    let nameAlt = '';
                    if (unit === 'A') {
                        if (valRaw < 1) {
                            val = precisionRound(valRaw, 3);
                        }
                        else {
                            val = precisionRound(valRaw, 2);
                        }
                    }
                    if (unit.startsWith('mcpm') || unit.startsWith('ncpm')) {
                        const num = unit.substr(4, 1);
                        nameAlt = (num === 'A')? unit.substr(0, 4) + '10': unit;
                        val = precisionRound(valRaw, 2);
                    } else {
                        nameAlt = nameLookup[unit];
                    }
                    if (nameAlt === undefined) {
                        const valueIndex = parseInt(unit, 10);
                        if (! isNaN(valueIndex)) {
                            nameAlt = 'val' + unit;
                        }
                    }

                    if (nameAlt !== undefined) {
                        payload[nameAlt + '_' + name] = val;
                    }
                }
            }
        }
        return payload;
    },
};

fz.ptvo_on_off = {
    cluster: 'genOnOff',
    type: ['attributeReport', 'readResponse'],
    convert: (model, msg, publish, options, meta) => {
        if (msg.data.hasOwnProperty('onOff')) {
            const channel = msg.endpoint.ID;
            const endpointName = `l${channel}`;
            const binaryEndpoint = model.meta && model.meta.binaryEndpoints && model.meta.binaryEndpoints[endpointName];
            const prefix = (binaryEndpoint) ? model.meta.binaryEndpoints[endpointName] : 'state';
            const property = `${prefix}_${endpointName}`;
        if (binaryEndpoint) {
              return {[property]: msg.data['onOff'] === 1};
            }
            return {[property]: msg.data['onOff'] === 1 ? 'OFF' : 'ON'};
        }
    },
  };

tz.on_off_invert = {
    key: ['state', 'on_time', 'off_wait_time'],
    convertSet: async (entity, key, value, meta) => {
        const state = meta.message.hasOwnProperty('state') ? meta.message.state.toLowerCase() : null;
        validateValue(state, ['toggle', 'off', 'on']);

        if (state === 'on' && (meta.message.hasOwnProperty('on_time') || meta.message.hasOwnProperty('off_wait_time'))) {
            const onTime = meta.message.hasOwnProperty('on_time') ? meta.message.on_time : 0;
            const offWaitTime = meta.message.hasOwnProperty('off_wait_time') ? meta.message.off_wait_time : 0;

            if (typeof onTime !== 'number') {
                throw Error('The on_time value must be a number!');
            }
            if (typeof offWaitTime !== 'number') {
                throw Error('The off_wait_time value must be a number!');
            }

            const payload = {ctrlbits: 0, ontime: Math.round(onTime * 10), offwaittime: Math.round(offWaitTime * 10)};
            await entity.command('genOnOff', 'onWithTimedOff', payload, getOptions(meta.mapped, entity));
        } else {

            
            if (state === 'toggle') {
                await entity.command('genOnOff', state, {}, getOptions(meta.mapped, entity));
                const currentState = meta.state[`state${meta.endpoint_name ? `_${meta.endpoint_name}` : ''}`];
                return currentState ? {state: {state: currentState === 'OFF' ? 'OFF' : 'ON'}} : {};
            } else {
                await entity.command('genOnOff', state === 'off' ? 'on' : 'off', {}, getOptions(meta.mapped, entity));
                return {state: {state: state === 'off' ? 'OFF' : 'ON'}};
            }
        }
    },
    convertGet: async (entity, key, meta) => {
        await entity.read('genOnOff', ['onOff']);
    },
};

tz.ptvo_switch_trigger = {
    key: ['restart', 'interval'],
    convertSet: async (entity, key, value, meta) => {
        value = parseInt(value);
        if (!value) {
            return;
        }

        if (key === 'restart') {
            await entity.command('genOnOff', 'onWithTimedOff', {ctrlbits: 0, ontime: Math.round(value*10), offwaittime: 0});
        } else if (key === 'interval') {
            await entity.configureReporting('genOnOff', [{
                attribute: 'onOff',
                minimumReportInterval: value,
                maximumReportInterval: value,
            }]);
        }

    },
    convertGet: async (entity, key, meta) => {
        await entity.read('genOnOff', ['onOff']);
    },
};

function precisionRound(number, precision) {
    if (typeof precision === 'number') {
        const factor = Math.pow(10, precision);
        return Math.round(number * factor) / factor;
    } else if (typeof precision === 'object') {
        const thresholds = Object.keys(precision).map(Number).sort((a, b) => b - a);
        for (const t of thresholds) {
            if (! isNaN(t) && number >= t) {
                return precisionRound(number, precision[t]);
            }
        }
    }
    return number;
}

function validateValue(value, allowed) {
    if (!allowed.includes(value)) {
        throw new Error(`'${value}' not allowed, choose between: ${allowed}`);
    }
}

function getOptions(definition, entity, options={}) {
    const allowed = ['disableDefaultResponse', 'timeout'];
    return getMetaValues(definition, entity, allowed, options);
}

function getMetaValues(definition, entity, allowed, options={}) {
    const result = {...options};
    if (definition && definition.meta) {
        for (const key of Object.keys(definition.meta)) {
            if (allowed == null || allowed.includes(key)) {
                const value = definition.meta[key];
                result[key] = typeof value === 'function' ? value(entity) : value;
            }
        }
    }

    return result;
}

function ptvo_on_off_config_exposes(epName) {
    const features = [];
    features.push(exposes.enum('switch_type', exposes.access.ALL,
        getSortedList(switchTypesList)).withEndpoint(epName));
    features.push(exposes.enum('link_to_output', exposes.access.ALL,
        getSortedList(inputLinkList)).withEndpoint(epName));
    features.push(exposes.enum('bind_command', exposes.access.ALL,
        getSortedList(bindCommandList)).withEndpoint(epName));
    return features;
}




const device = {
    zigbeeModel: ['ZigUSB'],
    model: 'ZigUSB',
    vendor: 'xyzroe.cc',
    description: '[Zigbee USB power monitor and switch](https://xyzroe.cc/ZigUSB)',
    fromZigbee: [fz.ignore_basic_report, fz.ptvo_on_off, fz.ptvo_switch_analog_input, fz.temperature, fz.ptvo_multistate_action, fz.legacy.ptvo_switch_buttons, fz.ptvo_on_off_config,],
    toZigbee: [tz.ptvo_switch_trigger, tz.on_off_invert, tz.ptvo_switch_analog_input, tz.ptvo_on_off_config,],
    exposes: [e.switch().withEndpoint('l1'),
      exposes.numeric('restart', ea.SET).withEndpoint('l1').withDescription('OFF time').withUnit('seconds'),
      ...ptvo_on_off_config_exposes('l1'),
      e.action(['single', 'double', 'triple', 'hold', 'release']),
      e.current().withAccess(ea.STATE).withEndpoint('l2'),
      e.voltage().withAccess(ea.STATE).withEndpoint('l2'),
      e.power().withAccess(ea.STATE).withEndpoint('l2'),
      exposes.numeric('interval', ea.SET).withEndpoint('l2').withDescription('Reporting interval').withUnit('sec'),
      e.cpu_temperature().withProperty('temperature').withEndpoint('l4'),
      exposes.numeric('uptime', ea.STATE).withEndpoint('l5').withDescription('CC2530').withUnit('seconds'),
],
    meta: {
        multiEndpoint: true,
        
    },
    endpoint: (device) => {
        return {
            l1: 1, l2: 2, l4: 4, l5: 5,
        };
    },
    configure: async (device, coordinatorEndpoint, logger) => {
            const endpoint = device.getEndpoint(1);
      await endpoint.read('genBasic', ['modelId', 'swBuildId', 'powerSource']);
    },
    icon: 'data:image/png;base64,',
};

module.exports = device;
